import React, { Component } from 'react';
import logo from './logo.svg';
import Form from "react-jsonschema-form";
import {Button,Navbar,Tabs,Tab,DropdownButton,Grid,Alert,TabContent} from "react-bootstrap";
import {Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle,CardImgOverlay} from 'reactstrap'
//import './App.css';
import Empl from  './components/employee_details'
class App extends Component {
  render() {
    return (
      <div className="App">
       <Navbar>
        <Tabs defaultActiveKey={1} id="uncontrolled-tab-example">
          <Tab eventKey={1} title  = "TAB_1">
            <br /> <br /> <br />
            <Card body inverse style={{ backgroundColor: '#333', borderColor: '#333' }}>
              <CardImg width="20%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97270&w=318&h=270&bg=333333&txtclr=666666" alt="Card image cap" />
              <CardImgOverlay>
                <CardTitle>Card Title</CardTitle>
                <CardText><b><i>This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</i></b></CardText>
                <CardText>
                  <small className="text-muted">Last updated 3 mins ago</small>
                </CardText>
              </CardImgOverlay>
            </Card>
            </Tab>
          <Tab eventKey={2} title  = "TAB_2" >
            <br />
            <br />
            <br />
            <TabContent><Empl /></TabContent>
          </Tab>
          <Tab eventKey={3} title = "TAB_3">TAB 3</Tab>
          <Tab eventKey={4}  title  = "TAB_4">TAB 4</Tab>
        </Tabs>
        </Navbar>
      </div>
    );
  }
}

export default App;
